function NavTab() {
    return (
        <div className="nav-tab">
          <button className="nav-tab__button"><a href="#about" className="nav-tab__button-link">О проекте</a></button>
          <button className="nav-tab__button"><a href="#technology" className="nav-tab__button-link">Технологии</a></button>
          <button className="nav-tab__button"><a href="#student" className="nav-tab__button-link">Студент</a></button>
        </div>
    );
}

export default NavTab;
